tables.table_schema:
CREATE TABLE data_analytics (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    data JSONB,
    created_at TIMESTAMP
);

CREATE TABLE data_sets (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    size INT,
    created_at TIMESTAMP
);

CREATE TABLE analytics_results (
    result_id INT PRIMARY KEY,
    data_set_id INT,
    result_description TEXT,
    result_date DATE,
    FOREIGN KEY (data_set_id) REFERENCES data_sets(id)
);

CREATE TABLE large_datasets (
    dataset_id INT PRIMARY KEY,
    dataset_name VARCHAR(255),
    dataset_description TEXT,
    dataset_size DECIMAL(10,2)
);

CREATE TABLE data_analytics (
    analytics_id INT PRIMARY KEY,
    analytics_name VARCHAR(255),
    analytics_description TEXT,
    analytics_method VARCHAR(50)
);

CREATE TABLE business_intelligence (
    bi_id INT PRIMARY KEY,
    bi_name VARCHAR(255),
    bi_description TEXT,
    bi_tools_used VARCHAR(100)
);

CREATE TABLE data_sets (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    description TEXT,
    created_at TIMESTAMP
);

CREATE TABLE query_results (
    id INT PRIMARY KEY,
    job_id INT,
    result_data JSON,
    created_at TIMESTAMP
);
